  <script src="/__JASMINE_ROOT__/lib/jasmine-0.10.1.js" type="text/javascript"></script>
  
  <script src="/__JASMINE_ROOT__/lib/TrivialReporter.js" type="text/javascript"></script>
  
  <script src="/__JASMINE_ROOT__/lib/json2.js" type="text/javascript"></script>

  
  <script src="/__JASMINE_ROOT__/lib/consolex.js" type="text/javascript"></script>
  

  <script type="text/javascript">
    var jsApiReporter;
    (function() {
      var jasmineEnv = jasmine.getEnv();

      jsApiReporter = new jasmine.JsApiReporter();
      var trivialReporter = new jasmine.TrivialReporter();

      jasmineEnv.addReporter(jsApiReporter);
      jasmineEnv.addReporter(trivialReporter);

      jasmineEnv.specFilter = function(spec) {
        return trivialReporter.specFilter(spec);
      };

      window.onload = function() {
        jasmineEnv.execute();
      };
    })();
  </script>

  
  <script src="/../../../../../../geniverse-jetty/webapps/geniverse/geniverse/geniverse.nocache.js" type="text/javascript"></script>
  
  <script src="/__spec__/ExampleSpec.js" type="text/javascript"></script>
